{
  "openapi": "3.0.0",
  "info": {
    "version": "2017-11-28",
    "x-release": "v4",
    "title": "Amazon GuardDuty",
    "description": "Amazon GuardDuty is a continuous security monitoring service that analyzes and processes the following data sources: VPC Flow Logs, AWS CloudTrail event logs, and DNS logs. It uses threat intelligence feeds (such as lists of malicious IPs and domains) and machine learning to identify unexpected, potentially unauthorized, and malicious activity within your AWS environment. This can include issues like escalations of privileges, uses of exposed credentials, or communication with malicious IPs, URLs, or domains. For example, GuardDuty can detect compromised EC2 instances that serve malware or mine bitcoin.  GuardDuty also monitors AWS account access behavior for signs of compromise. Some examples of this are unauthorized infrastructure deployments such as EC2 instances deployed in a Region that has never been used, or unusual API calls like a password policy change to reduce password strength.  GuardDuty informs you of the status of your AWS environment by producing security findings that you can view in the GuardDuty console or through Amazon CloudWatch events. For more information, see the  Amazon GuardDuty User Guide .",
    "x-logo": {
      "url": "https://raw.githubusercontent.com/chainjet/assets/master/integrations/aws/Arch_Amazon-GuardDuty_64.svg"
    },
    "termsOfService": "https://aws.amazon.com/service-terms/",
    "contact": {
      "name": "Mike Ralphson",
      "email": "mike.ralphson@gmail.com",
      "url": "https://github.com/mermade/aws2openapi",
      "x-twitter": "PermittedSoc"
    },
    "license": {
      "name": "Apache 2.0 License",
      "url": "http://www.apache.org/licenses/"
    },
    "x-providerName": "amazonaws.com",
    "x-serviceName": "guardduty",
    "x-origin": [
      {
        "contentType": "application/json",
        "url": "https://raw.githubusercontent.com/aws/aws-sdk-js/master/apis/guardduty-2017-11-28.normal.json",
        "converter": {
          "url": "https://github.com/mermade/aws2openapi",
          "version": "1.0.0"
        },
        "x-apisguru-driver": "external"
      }
    ],
    "x-apiClientRegistration": {
      "url": "https://portal.aws.amazon.com/gp/aws/developer/registration/index.html?nc2=h_ct"
    },
    "x-apisguru-categories": ["cloud"],
    "x-preferred": true
  },
  "externalDocs": {
    "description": "Amazon Web Services documentation",
    "url": "https://docs.aws.amazon.com/guardduty/"
  },
  "servers": [
    {
      "url": "http://guardduty.{region}.amazonaws.com",
      "variables": {
        "region": {
          "description": "The AWS region",
          "enum": [
            "us-east-1",
            "us-east-2",
            "us-west-1",
            "us-west-2",
            "us-gov-west-1",
            "us-gov-east-1",
            "ca-central-1",
            "eu-north-1",
            "eu-west-1",
            "eu-west-2",
            "eu-west-3",
            "eu-central-1",
            "eu-south-1",
            "af-south-1",
            "ap-northeast-1",
            "ap-northeast-2",
            "ap-northeast-3",
            "ap-southeast-1",
            "ap-southeast-2",
            "ap-east-1",
            "ap-south-1",
            "sa-east-1",
            "me-south-1"
          ],
          "default": "us-east-1"
        }
      },
      "description": "The Amazon GuardDuty multi-region endpoint"
    },
    {
      "url": "https://guardduty.{region}.amazonaws.com",
      "variables": {
        "region": {
          "description": "The AWS region",
          "enum": [
            "us-east-1",
            "us-east-2",
            "us-west-1",
            "us-west-2",
            "us-gov-west-1",
            "us-gov-east-1",
            "ca-central-1",
            "eu-north-1",
            "eu-west-1",
            "eu-west-2",
            "eu-west-3",
            "eu-central-1",
            "eu-south-1",
            "af-south-1",
            "ap-northeast-1",
            "ap-northeast-2",
            "ap-northeast-3",
            "ap-southeast-1",
            "ap-southeast-2",
            "ap-east-1",
            "ap-south-1",
            "sa-east-1",
            "me-south-1"
          ],
          "default": "us-east-1"
        }
      },
      "description": "The Amazon GuardDuty multi-region endpoint"
    },
    {
      "url": "http://guardduty.{region}.amazonaws.com.cn",
      "variables": {
        "region": {
          "description": "The AWS region",
          "enum": ["cn-north-1", "cn-northwest-1"],
          "default": "cn-north-1"
        }
      },
      "description": "The Amazon GuardDuty endpoint for China (Beijing) and China (Ningxia)"
    },
    {
      "url": "https://guardduty.{region}.amazonaws.com.cn",
      "variables": {
        "region": {
          "description": "The AWS region",
          "enum": ["cn-north-1", "cn-northwest-1"],
          "default": "cn-north-1"
        }
      },
      "description": "The Amazon GuardDuty endpoint for China (Beijing) and China (Ningxia)"
    }
  ],
  "x-hasEquivalentPaths": true,
  "paths": {
    "/detector/{detectorId}/master": {
      "post": {
        "operationId": "AcceptInvitation",
        "description": "Accepts the invitation to be monitored by a master GuardDuty account.",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/AcceptInvitationResponse"
                }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "InternalServerErrorException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalServerErrorException"
                }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "detectorId",
            "in": "path",
            "required": true,
            "description": "The unique ID of the detector of the GuardDuty member account.",
            "schema": { "type": "string", "minLength": 1, "maxLength": 300 }
          }
        ],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "required": ["masterId", "invitationId"],
                "properties": {
                  "masterId": {
                    "description": "The account ID of the master GuardDuty account whose invitation you're accepting.",
                    "type": "string"
                  },
                  "invitationId": {
                    "description": "The value that is used to validate the master account to the member account.",
                    "type": "string"
                  }
                }
              }
            }
          }
        },
        "summary": "Accept Invitation"
      },
      "parameters": [
        { "$ref": "#/components/parameters/X-Amz-Content-Sha256" },
        { "$ref": "#/components/parameters/X-Amz-Date" },
        { "$ref": "#/components/parameters/X-Amz-Algorithm" },
        { "$ref": "#/components/parameters/X-Amz-Credential" },
        { "$ref": "#/components/parameters/X-Amz-Security-Token" },
        { "$ref": "#/components/parameters/X-Amz-Signature" },
        { "$ref": "#/components/parameters/X-Amz-SignedHeaders" }
      ],
      "get": {
        "operationId": "GetMasterAccount",
        "description": "Provides the details for the GuardDuty master account associated with the current GuardDuty member account.",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/GetMasterAccountResponse"
                }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "InternalServerErrorException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalServerErrorException"
                }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "detectorId",
            "in": "path",
            "required": true,
            "description": "The unique ID of the detector of the GuardDuty member account.",
            "schema": { "type": "string", "minLength": 1, "maxLength": 300 }
          }
        ],
        "summary": "Get Master Account"
      }
    },
    "/detector/{detectorId}/findings/archive": {
      "post": {
        "operationId": "ArchiveFindings",
        "description": "<p>Archives GuardDuty findings that are specified by the list of finding IDs.</p> <note> <p>Only the master account can archive findings. Member accounts don't have permission to archive findings from their accounts.</p> </note>",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ArchiveFindingsResponse"
                }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "InternalServerErrorException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalServerErrorException"
                }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "detectorId",
            "in": "path",
            "required": true,
            "description": "The ID of the detector that specifies the GuardDuty service whose findings you want to archive.",
            "schema": { "type": "string", "minLength": 1, "maxLength": 300 }
          }
        ],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "required": ["findingIds"],
                "properties": {
                  "findingIds": {
                    "description": "The IDs of the findings that you want to archive.",
                    "type": "array",
                    "items": { "$ref": "#/components/schemas/FindingId" },
                    "minItems": 0,
                    "maxItems": 50
                  }
                }
              }
            }
          }
        },
        "summary": "Archive Findings"
      },
      "parameters": [
        { "$ref": "#/components/parameters/X-Amz-Content-Sha256" },
        { "$ref": "#/components/parameters/X-Amz-Date" },
        { "$ref": "#/components/parameters/X-Amz-Algorithm" },
        { "$ref": "#/components/parameters/X-Amz-Credential" },
        { "$ref": "#/components/parameters/X-Amz-Security-Token" },
        { "$ref": "#/components/parameters/X-Amz-Signature" },
        { "$ref": "#/components/parameters/X-Amz-SignedHeaders" }
      ]
    },
    "/detector": {
      "post": {
        "operationId": "CreateDetector",
        "description": "Creates a single Amazon GuardDuty detector. A detector is a resource that represents the GuardDuty service. To start using GuardDuty, you must create a detector in each Region where you enable the service. You can have only one detector per account per Region. All data sources are enabled in a new detector by default.",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/CreateDetectorResponse"
                }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "InternalServerErrorException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalServerErrorException"
                }
              }
            }
          }
        },
        "parameters": [],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "required": ["enable"],
                "properties": {
                  "enable": {
                    "description": "A Boolean value that specifies whether the detector is to be enabled.",
                    "type": "boolean"
                  },
                  "clientToken": {
                    "description": "The idempotency token for the create request.",
                    "type": "string",
                    "minLength": 0,
                    "maxLength": 64
                  },
                  "findingPublishingFrequency": {
                    "description": "An enum value that specifies how frequently updated findings are exported.",
                    "type": "string",
                    "enum": ["FIFTEEN_MINUTES", "ONE_HOUR", "SIX_HOURS"]
                  },
                  "dataSources": {
                    "description": "Contains information about which data sources are enabled.",
                    "type": "object",
                    "properties": {
                      "S3Logs": {
                        "allOf": [
                          {
                            "$ref": "#/components/schemas/S3LogsConfiguration"
                          },
                          {
                            "xml": { "name": "s3Logs" },
                            "description": "Describes whether S3 data event logs are enabled as a data source."
                          }
                        ]
                      }
                    }
                  },
                  "tags": {
                    "description": "The tags to be added to a new detector resource.",
                    "type": "object",
                    "minProperties": 1,
                    "maxProperties": 200,
                    "additionalProperties": {
                      "$ref": "#/components/schemas/TagValue"
                    }
                  }
                }
              }
            }
          }
        },
        "summary": "Create Detector"
      },
      "parameters": [
        { "$ref": "#/components/parameters/X-Amz-Content-Sha256" },
        { "$ref": "#/components/parameters/X-Amz-Date" },
        { "$ref": "#/components/parameters/X-Amz-Algorithm" },
        { "$ref": "#/components/parameters/X-Amz-Credential" },
        { "$ref": "#/components/parameters/X-Amz-Security-Token" },
        { "$ref": "#/components/parameters/X-Amz-Signature" },
        { "$ref": "#/components/parameters/X-Amz-SignedHeaders" }
      ],
      "get": {
        "operationId": "ListDetectors",
        "description": "Lists detectorIds of all the existing Amazon GuardDuty detector resources.",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ListDetectorsResponse"
                }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "InternalServerErrorException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalServerErrorException"
                }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "maxResults",
            "in": "query",
            "required": false,
            "description": "You can use this parameter to indicate the maximum number of items that you want in the response. The default value is 50. The maximum value is 50.",
            "schema": { "type": "integer", "minimum": 1, "maximum": 50 }
          },
          {
            "name": "nextToken",
            "in": "query",
            "required": false,
            "description": "You can use this parameter when paginating results. Set the value of this parameter to null on your first call to the list action. For subsequent calls to the action, fill nextToken in the request with the value of NextToken from the previous response to continue listing data.",
            "schema": { "type": "string" }
          },
          {
            "name": "MaxResults",
            "in": "query",
            "schema": { "type": "string" },
            "description": "Pagination limit",
            "required": false
          },
          {
            "name": "NextToken",
            "in": "query",
            "schema": { "type": "string" },
            "description": "Pagination token",
            "required": false
          }
        ],
        "summary": "List Detectors"
      }
    },
    "/detector/{detectorId}/filter": {
      "post": {
        "operationId": "CreateFilter",
        "description": "Creates a filter using the specified finding criteria.",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/CreateFilterResponse"
                }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "InternalServerErrorException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalServerErrorException"
                }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "detectorId",
            "in": "path",
            "required": true,
            "description": "The unique ID of the detector of the GuardDuty account that you want to create a filter for.",
            "schema": { "type": "string", "minLength": 1, "maxLength": 300 }
          }
        ],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "required": ["name", "findingCriteria"],
                "properties": {
                  "name": {
                    "description": "The name of the filter.",
                    "type": "string",
                    "minLength": 3,
                    "maxLength": 64
                  },
                  "description": {
                    "description": "The description of the filter.",
                    "type": "string",
                    "minLength": 0,
                    "maxLength": 512
                  },
                  "action": {
                    "description": "Specifies the action that is to be applied to the findings that match the filter.",
                    "type": "string",
                    "enum": ["NOOP", "ARCHIVE"],
                    "minLength": 1,
                    "maxLength": 300
                  },
                  "rank": {
                    "description": "Specifies the position of the filter in the list of current filters. Also specifies the order in which this filter is applied to the findings.",
                    "type": "integer",
                    "minimum": 1,
                    "maximum": 100
                  },
                  "findingCriteria": {
                    "description": "Contains information about the criteria used for querying findings.",
                    "type": "object",
                    "properties": {
                      "Criterion": {
                        "allOf": [
                          { "$ref": "#/components/schemas/Criterion" },
                          {
                            "xml": { "name": "criterion" },
                            "description": "Represents a map of finding properties that match specified conditions and values when querying findings."
                          }
                        ]
                      }
                    }
                  },
                  "clientToken": {
                    "description": "The idempotency token for the create request.",
                    "type": "string",
                    "minLength": 0,
                    "maxLength": 64
                  },
                  "tags": {
                    "description": "The tags to be added to a new filter resource.",
                    "type": "object",
                    "minProperties": 1,
                    "maxProperties": 200,
                    "additionalProperties": {
                      "$ref": "#/components/schemas/TagValue"
                    }
                  }
                }
              }
            }
          }
        },
        "summary": "Create Filter"
      },
      "parameters": [
        { "$ref": "#/components/parameters/X-Amz-Content-Sha256" },
        { "$ref": "#/components/parameters/X-Amz-Date" },
        { "$ref": "#/components/parameters/X-Amz-Algorithm" },
        { "$ref": "#/components/parameters/X-Amz-Credential" },
        { "$ref": "#/components/parameters/X-Amz-Security-Token" },
        { "$ref": "#/components/parameters/X-Amz-Signature" },
        { "$ref": "#/components/parameters/X-Amz-SignedHeaders" }
      ],
      "get": {
        "operationId": "ListFilters",
        "description": "Returns a paginated list of the current filters.",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/ListFiltersResponse" }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "InternalServerErrorException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalServerErrorException"
                }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "detectorId",
            "in": "path",
            "required": true,
            "description": "The unique ID of the detector that the filter is associated with.",
            "schema": { "type": "string", "minLength": 1, "maxLength": 300 }
          },
          {
            "name": "maxResults",
            "in": "query",
            "required": false,
            "description": "You can use this parameter to indicate the maximum number of items that you want in the response. The default value is 50. The maximum value is 50.",
            "schema": { "type": "integer", "minimum": 1, "maximum": 50 }
          },
          {
            "name": "nextToken",
            "in": "query",
            "required": false,
            "description": "You can use this parameter when paginating results. Set the value of this parameter to null on your first call to the list action. For subsequent calls to the action, fill nextToken in the request with the value of NextToken from the previous response to continue listing data.",
            "schema": { "type": "string" }
          },
          {
            "name": "MaxResults",
            "in": "query",
            "schema": { "type": "string" },
            "description": "Pagination limit",
            "required": false
          },
          {
            "name": "NextToken",
            "in": "query",
            "schema": { "type": "string" },
            "description": "Pagination token",
            "required": false
          }
        ],
        "summary": "List Filters"
      }
    },
    "/detector/{detectorId}/ipset": {
      "post": {
        "operationId": "CreateIPSet",
        "description": "Creates a new IPSet, which is called a trusted IP list in the console user interface. An IPSet is a list of IP addresses that are trusted for secure communication with AWS infrastructure and applications. GuardDuty doesn't generate findings for IP addresses that are included in IPSets. Only users from the master account can use this operation.",
        "responses": {
          "200": {
            "description": "Success",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/CreateIPSetResponse" }
              }
            }
          },
          "480": {
            "description": "BadRequestException",
            "content": {
              "application/json": {
                "schema": { "$ref": "#/components/schemas/BadRequestException" }
              }
            }
          },
          "481": {
            "description": "InternalServerErrorException",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/InternalServerErrorException"
                }
              }
            }
          }
        },
        "parameters": [
          {
            "name": "detectorId",
            "in": "path",
            "required": true,
            "description": "The unique ID of the detector of the GuardDuty account that you want to create an IPSet for.",
            "schema": { "type": "string", "minLength": 1, "maxLength": 300 }
          }
        ],
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "required": ["name", "format", "location", "activate"],
                "properties": {
                  "name": {
                    "description": "<p>The user-friendly name to identify the IPSet.</p> <p> Allowed characters are alphanumerics, spaces, hyphens (-), and underscores (_).</p>",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 300
                  },
                  "format": {
                    "description": "The format of the file that contains the IPSet.",
                    "type": "string",
                    "enum": [
                      "TXT",
                      "STIX",
                      "OTX_CSV",
                      "ALIEN_VAULT",
                      "PROOF_POINT",
                      "FIRE_EYE"
                    ],
                    "minLength": 1,
                    "maxLength": 300
                  },
                  "location": {
                    "description": "The URI of the file that contains the IPSet. For example: https://s3.us-west-2.amazonaws.com/my-bucket/my-object-key.",
                    "type": "string",
                    "minLength": 1,
                    "maxLength": 300
                  },
                  "activate": {
                    "description": "A Boolean value that indicates whether GuardDuty is to start using the uploaded IPSet.",
                    "type": "boolean"
                  },
                  "clientToken": {
                    "description": "The idempotency token for the create request.",
                    "type": "string",
                    "minLength": 0,
                    "maxLength": 64
                  },
                  "tags": {
                    "description": "The tags to be added to a new IP set resource.",
                    "type": "object",
                    "minProperties": 1,
                    "maxProperties": 200,
                    "additionalProperties": {
                      "$ref": "#/components/schemas/TagValue"
                    }
                  }
                }
              }
            }
          }
        },
        "summary": "Create IPSet"
